import { useNavigate} from "react-router-dom";

function Home() {
    const navigate = useNavigate();
    const pages = ["contact","about"]
  return (
    <div className="Home">
        <h1>HOME PAGE</h1>
        {pages.map(el=><p onClick={()=>navigate(`/${el}`)}>{el.toLocaleUpperCase()}</p>)}
    </div>
  );
}

export default Home;
